sap.ui.define(["../BaseController"],function(t){var o;return t.extend("asc.admin.controller.admin.AddAdminNotification",{onInit:function(){this.oRouter=this.getOwnerComponent().getRouter();o=new sap.ui.model.json.JSONModel("model/notification.json");this.getView().setModel(o,"notification")},onCancelPress:function(){this.oRouter.navTo("admin")},onSavePress:function(t){this.api.postNewNotification(o.getData()).done(this.onSaveNotificationDone.bind(this)).fail(this.onHTTPFail.bind(this))},onSaveNotificationDone:function(t){this.onToast("Success!");var o=this.getView().oPropagatedProperties.oModels.notifications;o.getData().push(t.data);o.setData(o.getData());this.oRouter.navTo("admin")}})},true);